    t[622] = "A command-line application supplied with I2P that is used to request URL resources, similar to <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> or <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget is also used internally by the router, for example to reseed from remote hosts. By default, eepget uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[623] = "Aplikasi baris perintah yang tersedia bersama I2P yang digunakan untuk meminta sumber daya URL, mirip dengan <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> atau <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget juga digunakan secara internal oleh router, misalnya untuk mengambil benih dari host jarak jauh. Defaultnya, eepget menggunakan proxy HTTP di <code>127.0.0.1:4444</code>.";
