    t[724] = "An eepsite is a website that is hosted anonymously on the I2P network - you can access it by configuring your web browser to use I2P's HTTP proxy (see above) and browsing to the <code>.i2p</code> suffixed website (e.g. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Also ensure your browser is configured to resolve DNS remotely when using the proxy to avoid DNS leaks.";
    t[725] = "Sebuah eepsite adalah situs web yang dihost secara anonim di jaringan I2P - Anda dapat mengaksesnya dengan mengkonfigurasi browser web untuk menggunakan proxy HTTP I2P (lihat di atas) dan menjelajahi situs web dengan akhiran <code>.i2p</code> (misal <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Pastikan juga browser Anda dikonfigurasi untuk menyelesaikan DNS secara jarak jauh saat menggunakan proxy untuk menghindari kebocoran DNS.";
