    t[836] = "The first number is the number of peers your router has sent or received a message from in the last few minutes. This may range from 8-10 to several hundred, depending on your total bandwidth, shared bandwidth, and locally-generated traffic. The second number is the number of peers seen in the last hour or so. Do not be concerned if these numbers vary widely. <a href='/configstats#router.activePeers'>[Enable graphing]</a>.";
    t[837] = "Angka pertama adalah jumlah rekan (peer) router Anda telah kirim atau terima pesan darinya dalam beberapa menit terakhir. Jumlah ini berkisar antara 8-10 hingga beberapa ratus, tergantung bandwidth total Anda, bandwidth yang dibagikan, dan lalu lintas yang dihasilkan secara lokal. Angka kedua adalah jumlah peer yang terlihat dalam satu jam terakhir. Jangan khawatir jika angka-angka ini bervariasi dengan lebar. <a href='/configstats#router.activePeers'>[Aktifkan grafik]</a>.";
