    t[980] = "Your webserver is running by default at <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, but is not accessible by others until you start the <i>I2P Webserver</i> tunnel. After starting the tunnel, your site will be difficult for other people to find. You could just tell people the destination or the Base32 address, but thankfully I2P has an address book to store domain names, and various services where you can <a href=/help/hostnameregistration>register a new .i2p domain</a> for free.";
    t[981] = "Webserver Anda berjalan secara bawaan di <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, namun tidak dapat diakses oleh orang lain hingga Anda menjalankan terowongan <i>Webserver I2P</i>. Setelah menjalankan terowongan, situs Anda akan sulit ditemukan oleh orang lain. Anda bisa memberitahu tujuan atau alamat Base32 kepada orang lain, untungnya I2P memiliki buku alamat untuk menyimpan nama domain, dan berbagai layanan di mana Anda dapat <a href=/help/hostnameregistration>mendaftarkan domain .i2p baru</a> secara gratis.";
