    t[1212] = "The skew (offset) of your computer's clock relative to the network-synced time (if known). I2P requires your computer's time be accurate. If the skew is more than a few seconds, please correct the problem by adjusting your computer's time. If I2P cannot connect to the internet, a reading of 0ms may be indicated. Note: This is only displayed in the <i>Router Information (advanced)</i> section. You may add this section to your Sidebar on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[1213] = "Pergeseran (offset) jam komputer Anda relatif terhadap waktu jaringan yang disinkronisasi (bila diketahui). I2P membutuhkan waktu komputer Anda yang akurat. Jika pergeseran lebih dari beberapa detik, silakan perbaiki masalah dengan menyesuaikan waktu komputer Anda. Jika I2P tidak dapat tersambung ke internet, pembacaan 0ms mungkin ditunjukkan. Catatan: Informasi ini hanya ditampilkan di bagian <i>Informasi Router (lanjut)</i>. Anda dapat menambahkan bagian ini ke Sidebar Anda di halaman <a href='/configsidebar'>Konfigurasi Sidebar</a>.";
