    t[2250] = "How long jobs are waiting before execution. The job queue is listed on the <a href='/jobs'>Jobs page</a>. Unfortunately, there are several other job queues in the router that may be congested, and their status is not available in the router console. The job lag should generally be zero. If it is consistently higher than 500ms, your computer is very slow, your network is experiencing connectivity issues, or the router has serious problems. <a href='/configstats#jobQueue.jobLag'>[Enable graphing]</a>.";
    t[2251] = "Berapa lama pekerjaan menunggu sebelum dieksekusi. Antrian pekerjaan terdapat di halaman <a href='/jobs'>Pekerjaan</a>. Sayangnya, ada beberapa antrian pekerjaan lain di router yang mungkin terkongesti, dan status mereka tidak tersedia di konsol router. Keterlambatan pekerjaan secara umum seharusnya nol. Jika konsisten lebih tinggi dari 500ms, komputer Anda sangat lambat, jaringan Anda mengalami masalah konektivitas, atau router mengalami masalah serius. <a href='/configstats#jobQueue.jobLag'>[Aktifkan grafik]</a>.";
