    t[2254] = "Before you tell the world about your new website, you should add some content. Go to the server's root directory <a href=#rootdir>listed above</a> and replace the <i>index.html</i> redirect page with your own content. If you need a template for a basic site, feel free to adapt <a href=http://127.0.0.1:7658/help/pagetemplate.html>this page</a>. If you're returned to this page after editing the content, try clearing your browser's web cache.";
    t[2255] = "Sebelum memberitahu dunia tentang situs web baru Anda, Anda sebaiknya menambahkan konten. Bukalah direktori root server <a href=#rootdir>yang tercantum diatas</a> dan gantilah halaman pengalihan <i>index.html</i> dengan konten milik Anda sendiri. Jika Anda membutuhkan template untuk situs dasar, bebaslah menyesuaikan <a href=http://127.0.0.1:7658/help/pagetemplate.html>halaman ini</a>. Jika Anda dikembalikan ke halaman ini setelah mengedit konten, coba bersihkan cache web browser Anda.";
