    t[2376] = "To obtain your own hostname, I2P domain registrars such as <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> or <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> provide registration services that allow you to register and manage an .i2p hostname or sub-domain which will then be propagated across the network. Some registration sites will require the <i>B64 destination address</i> for the tunnel/service you wish to associate with a hostname, which you should copy from the <i>Local destination</i> section on the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>.";
    t[2377] = "Untuk mendapatkan hostname Anda sendiri, registrar domain I2P seperti <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> atau <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> menyediakan layanan pendaftaran yang memungkinkan Anda untuk mendaftar dan mengelola hostname .i2p atau sub-domain yang kemudian akan tersebar di seluruh jaringan. Beberapa situs pendaftaran akan mengharuskan <i>B64 destination address</i> untuk terowongan/layanan yang ingin Anda kaitkan dengan hostname, yang sebaiknya Anda salin dari bagian <i>Tujuan Lokal</i> di halaman <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Konfigurasi Pengelola Terowongan</a>.";
