    t[2482] = "This indicates the amount of RAM I2P is using, and the total amount available, allocated by Java. If the usage is consistently high relative to the available RAM, this may indicate that you need to increase the ram allocated to the JVM. You can allocate more RAM by editing your <code>wrapper.config</code> file which is normally located in the I2P application directory. You will need to edit the <code>wrapper.java.maxmemory</code> parameter, which by default is set to 256(MB) for I2P, or 384 for I2P+. Note: if the memory bar is enabled, the memory entry in the router info section will be suppressed.";
    t[2483] = "Ini menunjukkan jumlah RAM yang digunakan I2P, dan jumlah total yang tersedia, dialokasikan oleh Java. Jika penggunaan secara konsisten tinggi relatif terhadap RAM yang tersedia, ini dapat menunjukkan bahwa Anda perlu meningkatkan alokasi RAM untuk JVM. Anda dapat mengalokasikan lebih banyak RAM dengan mengedit file <code>wrapper.config</code> Anda yang biasanya berada di direktori aplikasi I2P. Anda akan perlu mengedit parameter <code>wrapper.java.maxmemory</code>, yang secara default diatur ke 256(MB) untuk I2P, atau 384 untuk I2P+. Catatan: jika garis ingatan diaktifkan, entri ingatan di bagian informasi router akan ditindih.";
