    t[2538] = "To serve your own static content, you only need to edit or replace the files in the webserver's root directory, and the site will be available on the I2P network after you've followed the instructions below. Additionally, cgi and python scripts can be run from the <code>cgi-bin</code> directory immediately above <code>docroot</code> if you have <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> and <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a> installed.";
    t[2539] = "Untuk menyajikan konten statis milik sendiri, Anda hanya perlu mengedit atau mengganti file-file pada direktori root webserver, dan situs akan tersedia di jaringan I2P setelah Anda mengikuti instruksi di bawah ini. Selain itu, skrip cgi dan python dapat dijalankan dari direktori <code>cgi-bin</code> yang terletak tepat di atas <code>docroot</code> jika Anda telah menginstal <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> dan <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a>.";
