    t[2578] = "Many of the stats on the sidebar may be <a href='/configstats'>configured</a> to be <a href='/graphs'>graphed</a> for further analysis. You may also customize the sections that appear on the Sidebar and their positioning on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[2579] = "Banyak statistik di samping dapat <a href='/configstats'>dikonfigurasi</a> untuk <a href='/graphs'>digrafikan</a> untuk analisis lebih lanjut. Anda juga dapat menyesuaikan bagian yang muncul di Samping dan posisinya di halaman <a href='/configsidebar'>Konfigurasi Samping</a>.";
    t[2582] = "This tunnel-specific setting allows you to enable or disable replies to pings sent to servers hosted by the router. To disable pings, you must add the line <code>i2p.streaming.answerPings=false</code> to the <i>Custom Options</i> section for the server's configuration in the Tunnel Manager.";
    t[2583] = "Pengaturan ini khusus terowongan memungkinkan Anda mengaktifkan atau menonaktifkan balasan terhadap ping yang dikirim ke server yang dihosting router. Untuk menonaktifkan ping, Anda harus menambahkan baris <code>i2p.streaming.answerPings=false</code> ke bagian <i>Opsi Khusus</i> untuk konfigurasi server di Manajer Terowongan.";
