    t[2598] = "If you wish to install unsigned (.zip) I2P updates, this should be added to your <code>router.config</code> file unless you have already configured <code>routerconsole.advanced=true</code>, in which case this option is already provisioned. Note: as of I2P+ 0.9.48+, installation of <a href=/configupdate#i2pupdates>unsigned updates</a> is enabled by default.";
    t[2599] = "Jika Anda ingin memasang pembaruan I2P yang tidak ditandatangani (.zip), ini harus ditambahkan ke file <code>router.config</code> Anda kecuali Anda sudah mengkonfigurasi <code>routerconsole.advanced=true</code>, yang mana opsi ini sudah disediakan. Catatan: mulai I2P+ 0.9.48+, pemasangan <a href=/configupdate#i2pupdates>pembaruan tidak ditandatangani</a> diaktifkan secara default.";
