    t[2696] = "This setting (in seconds) allows you to override the delay between runs of the Peer Exploration Job which attempts to locate new peers to add to the NetDb. The job will run every 80 seconds by default, or if the router is experiencing job or message lag, every 3 minutes. If the size of the NetDb reaches 4000 peers, the pause will increase to 15 minutes. You may wish to increase the delay if your NetDb is well-populated (over 2000 peers), or if you wish to reduce overall bandwidth usage. Note: For Floodfill routers, this job does not run.";
    t[2697] = "Pengaturan ini (dalam hitungan detik) memungkinkan Anda untuk mengganti penundaan antara menjalankan Pekerjaan Eksplorasi Sejawat yang mencoba menemukan rekan baru untuk ditambahkan ke NetDb. Pekerjaan akan berjalan setiap 80 detik secara default, atau jika router mengalami kelambatan pekerjaan atau pesan, setiap 3 menit. Jika ukuran NetDb mencapai 4000 peer, jeda akan bertambah menjadi 15 menit. Anda mungkin ingin menambah penundaan jika NetDb Anda memiliki populasi yang banyak (lebih dari 2000 rekan), atau jika Anda ingin mengurangi penggunaan bandwidth secara keseluruhan. Catatan: Untuk router Floodfill, pekerjaan ini tidak berjalan.";
    t[2698] = "Current";
