    t[2721] = "Situs web yang dihoskan di jaringan I2P. Secara default, <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>server web Jetty</a> dikonfigurasi dan berjalan pada <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2722] = "Can be disabled or changed in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Can also be configured to bind to a specific interface or all interfaces.";
    t[2723] = "Dapat dinonaktifkan atau diubah di <a href=/i2ptunnelmgr>Pengelola Terowongan</a>. Juga dapat dikonfigurasi untuk terikat ke antarmuka tertentu atau semua antarmuka.";
