    t[2766] = "In order to access websites hosted on I2P, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P HTTP proxy, by default running on <code>127.0.0.1 port 4444</code>. Most browsers offer an option to configure your proxy; in this mini-tutorial we'll focus on Firefox.";
    t[2767] = "Untuk mengakses situs web yang dihosting di I2P, dan opsional menggunakan outproxy default untuk menghubungkan ke situs web di clearnet, Anda perlu mengonfigurasi browser Anda untuk menggunakan proxy HTTP I2P, secara default berjalan pada <code>127.0.0.1 port 4444</code>. Sebagian besar browser menawarkan pilihan untuk mengonfigurasi proxy Anda; dalam tutorial mini ini kami akan fokus pada Firefox.";
