    t[2798] = "I2P+ functions best when you can accurately reflect the speed of your network connection in the <a href=/config>bandwidth configuration section</a>. By default I2P+ is configured with some fairly conservative values that will not suit many use cases, so please take time to review these settings and correct where necessary. The more bandwidth you allocate, <i>specifically</i> upstream bandwidth, the more you will benefit from the network.";
    t[2799] = "I2P+ bekerja paling baik ketika Anda dapat merefleksikan kecepatan koneksi jaringan Anda dengan akurat pada bagian <a href=/config>konfigurasi bandwidth</a>. Secara default, I2P+ dikonfigurasi dengan beberapa nilai yang cukup konservatif yang tidak sesuai untuk banyak kasus penggunaan, jadi tolong gunakan waktu untuk meninjau pengaturan ini dan koreksi jika perlu. Semakin banyak bandwidth yang Anda alokasikan, <i>khususnya</i> bandwidth hulu, semakin besar manfaat yang akan Anda peroleh dari jaringan.";
