    t[2882] = "The I2P Network Protocol (I2NP) manages the routing and mixing of messages between routers, in addition to the transport selection (where more than one is supported) when communicating with a peer. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[2883] = "Protokol Jaringan I2P (I2NP) mengelola penerjangan dan pencampuran pesan antara router, di samping pemilihan transportasi (di mana lebih dari satu didukung) saat berkomunikasi dengan rekan sejajar. Untuk informasi lebih lanjut, lihat <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>dokumentasi online</a>.";
    t[2884] = "Expired {0} ago";
    t[2885] = "Kadaluarsa dalam {0} yang lalu";
    t[2892] = "Your router's status on accepting or rejecting requests from other routers to build a participating tunnel through your router. Your router may accept all requests, accept or reject a percentage of requests, or reject all requests for a number of reasons, to control the bandwidth and CPU demands and maintain capacity for local clients. <b>Note";
    t[2893] = "Status router Anda dalam menerima atau menolak permintaan dari router lain untuk membangun terowongan yang berpartisipasi melalui router Anda. Router Anda dapat menerima semua permintaan, menerima atau menolak persentase permintaan, atau menolak semua permintaan untuk berbagai alasan, untuk mengontrol permintaan bandwidth dan CPU serta mempertahankan kapasitas untuk klien lokal. <b>Catatan";
    t[2902] = "Please contact a known trustworthy friend who has a running I2P router, and ask them for help with reseeding your I2P router. Request that they send you a reseed file exported from their running I2P router. It is vital that the file is exchanged over a secure channel, e.g. encrypted to avoid external tampering (PGP Sign, Encrypt and Verified with a trusted public key). The file itself is unsigned, so please accept files only from known trusted friends. Never import a reseed file if you cannot verify its source.";
    t[2903] = "Silahkan hubungi teman yang Anda kenal dan percayai yang memiliki router I2P yang berjalan, dan minta bantuan mereka untuk mereseed router I2P Anda. Mintalah mereka mengirimkan file reseed yang diekspor dari router I2P milik mereka yang sedang berjalan. Penting bahwa file tersebut dipertukarkan melalui saluran yang aman, misalnya dienkripsi untuk menghindari manipulasi eksternal (Tanda Tangan PGP, Enkripsi dan Verifikasi dengan kunci publik yang terpercaya). File itu sendiri tidak ditandatangani, jadi tolong terimalah file hanya dari teman yang Anda kenal dan percayai saja. Jangan pernah impor file reseed jika Anda tidak dapat memverifikasi sumbernya.";
    t[2916] = "Last Good Send";
