    t[2920] = "You can use a recorder in one tunnel that writes to a file that another tunnel, or multiple tunnels, can use for throttling. These files can also be edited by hand.";
    t[2921] = "Anda dapat menggunakan perekam dalam satu terowongan yang menulis ke file yang dapat digunakan oleh terowongan lain, atau beberapa terowongan, untuk pembatasan. File-file ini juga dapat diedit dengan tangan.";
