    t[2956] = "The Java web applications listed below are started by the webConsole client and run in the same JVM as the router. They are usually web applications accessible through the router console. They may be complete applications (e.g. i2psnark), front-ends to another client or application which must be separately enabled (e.g. susidns, i2ptunnel), or have no web interface at all (e.g. addressbook).";
    t[2957] = "Aplikasi web Java yang tercantum di bawah ini dimulai oleh webConsole client dan dijalankan di JVM yang sama dengan Router I2P. Mereka biasanya adalah aplikasi web yang dapat diakses melalui router console. Mereka mungkin merupakan aplikasi lengkap (mis. I2Psnark), front-end milik klien atau aplikasi lain yang harus diaktifkan secara terpisah (misalnya susidns, i2ptunnel), atau tidak memiliki antarmuka web sama sekali (misalnya buku alamat).";
