    t[2978] = "This is the total number of peers that are known by your router. They are listed on the <a href='/netdb'>Network Database page</a>. This may range from under 100 to 1000 or more. This number is not the total size of the network; it may vary widely depending on your total bandwidth, shared bandwidth, and locally-generated traffic. I2P does not require a router to know every other router in the network.";
    t[2979] = "Ini adalah total jumlah peer yang dikenal oleh router Anda. Mereka terdaftar di halaman <a href='/netdb'>Basis Data Jaringan</a>. Jumlah ini dapat berkisar dari di bawah 100 hingga 1000 atau lebih. Jumlah ini bukanlah ukuran total jaringan; ini dapat bervariasi dengan lebar tergantung pada total bandwidth, bandwidth yang dibagikan, dan lalu lintas yang dihasilkan secara lokal. I2P tidak mengharuskan router untuk mengetahui seluruh router lain di jaringan.";
