    t[3062] = "You can override the <a href=http://127.0.0.1:7658/help/images/>default appearance</a> of the directory listing by supplying an edited <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> file to set a global appearance. Note that this file will not be displayed in the webserver's directory listing. Files and directories prefixed with . and files named favicon.ico or files ending with ~ or .bak or .old will also be hidden from view (though still accessible). Note: To create hidden files with a . prefix on Windows, add a trailing . to the file or directory e.g. <code>.hidden.</code>; Windows explorer will then save the file with the correct name, removing the trailing dot in the process.";
    t[3063] = "Anda dapat mengabaikan penampilan <a href=http://127.0.0.1:7658/help/images/>bawaan</a> daftar direktori dengan menyediakan file <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> yang telah diedit untuk menyetel penampilan global. Perhatikan bahwa file ini tidak akan ditampilkan dalam daftar direktori webserver. File dan direktori yang diawali titik beserta file bernama favicon.ico atau berakhiran ~ atau .bak atau .old juga akan tersembunyi (meski masih dapat diakses). Catatan: Untuk membuat file tersembunyi dengan awalan titik besar di Windows, tambahkan titik di akhir file atau direktori contoh <code>.hidden.</code>; Windows explorer akan menyimpan file dengan nama benar, sambil menghilangkan titik di akhir.";
