    t[3490] = "A variant of onion routing that encrypts multiple messages together to make it more difficult for attackers to perform traffic analysis and to increase the speed of data transfer. For more information, see the <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[3491] = "Variasi dari penerjangan bawang yang mengenkripsi beberapa pesan bersama untuk membuat lebih sulit bagi penyerang melakukan analisis lalu lintas dan meningkatkan kecepatan transfer data. Untuk informasi lebih lanjut, lihat <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>dokumentasi online</a>.";
    t[3494] = "How to Harden Your WordPress Site";
    t[3495] = "Cara Memperkuat Situs WordPress Anda";
    t[3496] = "I2P Internals";
    t[3497] = "I2P Internal";
    t[3500] = "By default, I2P is supplied with a webserver to host your own anonymized website (traditionally referred to as an <i>eepsite</i>). Both the site and the I2P Router Console are running on a streamlined version of <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, customized for I2P.";
    t[3501] = "Secara default, I2P dilengkapi dengan webserver untuk men-host situs web Anda sendiri yang dianonimkan (tradisional disebut <i>eepsite</i>). Baik situs maupun Konsol Router I2P menjalankan versi diringkas dari <a href='https://id.wikipedia.org/wiki/Jetty_(server_web)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, yang disesuaikan untuk I2P.";
    t[3504] = "This setting allows you to exclude older routers from your NetDb. Routers older than the default or the value you set will be deleted from the NetDb and banned for the duration of the router session. By default, routers older than 0.9.20 are excluded. Note: starting with I2P+ version 0.9.46+, only routers running very recent versions are used for building local tunnels. [Restart required]";
    t[3505] = "Pengaturan ini memungkinkan Anda untuk mengecualikan router lama dari NetDb Anda. Router yang lebih lama dari default atau nilai yang Anda tetapkan akan dihapus dari NetDb dan dilarang selama sesi router. Secara default, router yang lebih lama dari 0.9.20 dikecualikan. Catatan: dimulai dengan I2P+ versi 0.9.46+, hanya router yang menjalankan versi terbaru yang digunakan untuk membangun terowongan lokal. [Diperlukan mulai ulang]";
