    t[3962] = "Some IRC clients are configured to disconnect from the server if there's been no communication with the server for a period of time, which can sometimes be problematic for I2P IRC if the <i>ping timeout</i> value is set too low. Setting the ping timeout value in your client to a high value (e.g. 320 seconds) will often result in a more robust connection to the network. In hexchat you can configure the value by typing <code>/set net_ping_timeout 320</code>. This will write the value to your <code>hexchat.conf</code> file.";
    t[3963] = "Beberapa klien IRC dikonfigurasi untuk terputus dari server jika tidak ada komunikasi dengan server selama periode waktu tertentu, yang kadang bisa menjadi masalah untuk I2P IRC jika nilai <i>ping timeout</i> diatur terlalu rendah. Mengatur nilai ping timeout di klien Anda ke nilai tinggi (misal 320 detik) seringkali akan menghasilkan koneksi yang lebih robust ke jaringan. Di hexchat Anda dapat mengkonfigurasi nilainya dengan mengetikkan <code>/set net_ping_timeout 320</code>. Hal ini akan menulis nilai ke file <code>hexchat.conf</code> Anda.";
