    t[5514] = "If after a few minutes of uptime your router is indicating 0 Active Peers and 0 Known Peers, with a notification in the sidebar that you need to check your network connection, verify that you can access the internet. If your internet connection is functional, you may need to unblock Java in your firewall. Otherwise, you may need to reseed your I2P router. Visit the <a href=/configreseed#reseedconfig>Reseed Configuration page</a> and click the <i>Save Changes and Reseed Now</i> button. For more information, see the <a href=#reseedhelp>Reseed help section</a> above.";
    t[5515] = "Jika setelah beberapa menit uptime, router Anda menunjukkan 0 Active Peers dan 0 Known Peers, dengan notifikasi di sidebar bahwa Anda perlu memeriksa koneksi jaringan Anda, verifikasi bahwa Anda dapat mengakses internet. Jika koneksi internet Anda berfungsi, Anda mungkin perlu membuka blokir Java di firewall Anda. Jika tidak, Anda mungkin perlu menyemai ulang router I2P Anda. Kunjungi halaman <a href=/configreseed#reseedconfig>Konfigurasi Reseed</a> dan klik tombol <i>Simpan Perubahan dan Reseed Sekarang</i>. Untuk informasi lebih lanjut, lihat bagian bantuan Reseed di atas <a href=#reseedhelp>Reseed help section</a>.";
    t[5518] = "A higher level socket API for clients. Only opened when a SAM V3 client requests a UDP session. Can be enabled/disabled on the <a href=/configclients> Client Configuration page</a>. Can be changed in the <code>clients.config</code> file with the SAM command line option <code>sam.udp.port=nnnn</code>.";
    t[5519] = "API soket tingkat tinggi untuk klien. Hanya dibuka ketika klien SAM V3 meminta sesi UDP. Dapat diaktifkan/dinonaktifkan di halaman <a href=/configclients>Konfigurasi Klien</a>. Dapat diubah di file <code>clients.config</code> dengan opsi baris perintah SAM <code>sam.udp.port=nnnn</code>.";
    t[5526] = "If you want your site to feel responsive, image compression is essential when hosting large images. Using a service like <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> to compress your png and jpeg images will often result in much smaller files with minimal loss of quality. In some situations the webp format can best jpegs, generating smaller files with approximately the same or better visual fidelity, and has wide browser support. Also consider using svgs instead of bitmaps for icons and illustrations - they're often smaller than the equivalent bitmap file (run them through a service like <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> to remove unneeded cruft), scale without loss of quality, and can be gzipped by your webserver.";
    t[5527] = "Jika Anda ingin situs Anda terasa responsif, kompresi gambar sangat penting saat meng-host gambar-gambar besar. Menggunakan layanan seperti <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> untuk mengompres gambar png dan jpeg Anda sering menghasilkan file yang lebih kecil dengan kerugian kualitas minimal. Dalam beberapa situasi, format webp dapat menggantikan jpeg, menghasilkan file yang lebih kecil dengan tingkat kejelasan visual yang sama atau lebih baik, dan memiliki dukungan browser yang luas. Pertimbangkan juga untuk menggunakan svg alih-alih bitmap untuk ikon dan ilustrasi - mereka seringkali lebih kecil dari file bitmap yang setara (lewatkan melalui layanan seperti <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> untuk menghapus hal-hal yang tidak diperlukan), dapat diubah skala tanpa kerugian kualitas, dan dapat dikompresi gzip oleh webserver Anda.";
    t[5528] = "UPnP disabled on the device";
