    t[5536] = "By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels (for performance reasons) and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i> in the sidebar under Service Tunnels and on the <a href=/tunnels>Tunnels page</a>.";
    t[5537] = "Secara default, sebagian besar layanan klien Anda (surel, proxy HTTP, IRC) akan berbagi set terowongan yang sama (untuk alasan kinerja) dan terdaftar sebagai <i>Klien Berbagi</i> dan <i>Klien Berbagi(DSA)</i> di sisi panel di bawah Terowongan Layanan dan di halaman <a href=/tunnels>Terowongan</a>.";
