    t[5545] = "Bagian ini tidak diaktifkan secara default kecuali mode <a href='/help/configuration#advancedconsole'>Konsol Lanjutan</a> diaktifkan. Anda dapat mengaktifkannya di halaman <a href='/configsidebar'>Konfigurasi Sidebar</a>.";
