    t[5716] = "Open <a href=/confignet#udpconfig>I2P+'s port</a> on your modem, router and/or firewall(s) for better connectivity (ideally both UDP and TCP). More information on how to go about port forwarding can be found at <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, in addition to our forums and IRC channels listed below. Note that I2P does not support connecting to the internet via an http or socks proxy [patches welcome!], though you can connect to proxies via I2P itself once connected to the network.";
    t[5717] = "Buka <a href=/confignet#udpconfig>port I2P+</a> di modem, router dan/atau firewall Anda untuk konektivitas yang lebih baik (idealisnya baik UDP maupun TCP). Informasi lebih lanjut tentang cara melakukan pembocoran port dapat ditemukan di <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, selain forum dan saluran IRC yang tercantum di bawah. Perhatikan bahwa I2P tidak mendukung koneksi ke internet melalui proxy http atau socks [kode yang disambut!], meskipun Anda dapat mengkoneksikan proxy melalui I2P sendiri setelah terkoneksi ke jaringan.";
    t[5730] = "A tunnel filter can provide protection against denial of service attacks, without otherwise interrupting the service for genuine users, either in conjunction with the tunnel throttler or as an alternative strategy. It can also be used to log access to a hosted service to determine if the server is under attack, or simply to log all visitors by I2P destination. Additionally, a filter can function simultaneously as a whitelist and blacklist making it more flexible than the Tunnel Manager's access list controls. Note that multiple server tunnels can share a single filter file if you wish to implement a global filter.";
    t[5731] = "Filter terowongan dapat memberikan perlindungan terhadap penolakan serangan layanan, tanpa mengganggu layanan untuk pengguna asli, baik dalam hubungannya dengan throttler terowongan atau sebagai strategi alternatif. Ini juga dapat digunakan untuk mencatat akses ke layanan yang di -host untuk menentukan apakah server diserang, atau hanya untuk mencatat semua pengunjung berdasarkan tujuan I2P. Selain itu, filter dapat berfungsi secara bersamaan sebagai daftar putih dan daftar hitam membuatnya lebih fleksibel daripada kontrol daftar akses manajer terowongan. Perhatikan bahwa beberapa terowongan server dapat berbagi file filter tunggal jika Anda ingin menerapkan filter global.";
