    t[6026] = "This setting (in milliseconds) allows you to manually configure the delay between router refresh updates run by the Refresh Routers Job. By default the pause between refreshes is determined by the size of the NetDb, and introduces some randomness in the timing to mitigate traffic analysis. For values lower than 2000 milliseconds, increasing the value of <code>router.refreshTimeout</code> is recommended. Note that setting this value below 2000 milliseconds will increase your network traffic and may introduce job lag, and is not recommended for sustained use.";
    t[6027] = "Pengaturan ini (dalam milidetik) memungkinkan Anda mengonfigurasi secara manual penundaan antara pembaruan refresh router yang dijalankan oleh Pekerjaan Refresh Router. Secara default, penundaan antara refresh ditentukan oleh ukuran NetDb, dan memperkenalkan sejumlah keacakan dalam waktu untuk memitigasi analisis lalu lintas. Untuk nilai di bawah 2000 milidetik, merekomendasikan meningkatkan nilai <code>router.refreshTimeout</code>. Perlu dicatat bahwa mengatur nilai ini di bawah 2000 milidetik akan meningkatkan lalu lintas jaringan Anda dan mungkin memperkenalkan tundaan pekerjaan, dan tidak direkomendasikan untuk penggunaan berkelanjutan.";
    t[6030] = "Server tunnels, configurable in the <a href=/i2ptunnelmgr>Tunnel Manager</a>, provide a number of ways to limit access to the hosted service. Destination whitelisting, blacklisting, connection throttling, and tunnel filtering are methods provisioned to mitigate denial of service attacks, grant exclusive access to known I2P destinations, and manage traffic to the server.";
    t[6031] = "Terowongan server, yang dapat dikonfigurasi di <a href=/i2ptunnelmgr>Pengelola Terowongan</a>, menyediakan beberapa cara untuk membatasi akses ke layanan terhosting. Pemutihdaftaran tujuan, daftar hitam, pengaturan laju koneksi, dan penyaringan terowongan adalah metode yang disediakan untuk memitigasi serangan penolakan layanan, memberikan akses eksklusif ke tujuan I2P yang diketahui, dan mengelola lalu lintas ke server.";
