    t[6944] = "A java implementation of a Tor client, available as an I2P plugin. Can be used as the default <i>outproxy</i> if configured in the relevant SOCKS or HTTP client tunnel in the <i>Tunnel Manager</i>. Available from <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Source code is available on <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6945] = "Implementasi Java dari klien Tor, tersedia sebagai plugin I2P. Dapat digunakan sebagai <i>outproxy</i> default jika dikonfigurasi di terowongan klien SOCKS atau HTTP yang relevan di <i>Pengelola Terowongan</i>. Tersedia dari <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Kode sumber tersedia di <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6952] = "IPv4 Addresses";
    t[6953] = "Alamat IPv4";
    t[6956] = "This section indicates your average bandwidth speeds and total usage for the session. All values are in bytes per second. You may change your bandwidth limits on the <a href='/config'>Bandwidth Configuration page</a>. The more bandwidth you make available, the more you help the network and improve your own anonymity, so please take the time to review the settings. If you are unsure of your network's speed, using a service such as <a href='http://speedtest.net/'>SpeedTest</a> or similar will give you a good indication of your bandwidth capability. Your upstream share amount (KBps Out) will determine your overall contribution to the network. Bandwidth is <a href='/graphs'>graphed</a> by default.";
    t[6957] = "Bagian ini menunjukkan kecepatan bandwidth rata-rata dan total penggunaan Anda untuk sesi ini. Semua nilai dalam byte per detik. Anda dapat mengubah batasan bandwidth di halaman <a href='/config'>Konfigurasi Bandwidth</a>. Semakin banyak bandwidth yang Anda sediakan, semakin Anda membantu jaringan dan meningkatkan anonimitas Anda sendiri, jadi tolong luangkan waktu untuk meninjau pengaturan. Jika Anda ragu dengan kecepatan jaringan Anda, menggunakan layanan seperti <a href='http://speedtest.net/'>SpeedTest</a> atau serupa akan memberikan indikasi yang baik tentang kapabilitas bandwidth Anda. Jumlah pembagian upstream Anda (KBps Keluar) akan menentukan kontribusi keseluruhan Anda untuk jaringan. Bandwidth <a href='/graphs'>digrafikan</a> secara default.";
