    t[7004] = "This setting allows you to configure the minimum number of hosted participating tunnels before the router starts to reject tunnel requests based on anticipated bandwidth requirements. [Default is 100 if system is running Android, 800 if system is running on ARM and less than 4 cores available, 1200 if system is running on ARM and 4 or more cores available, otherwise 2500]";
    t[7005] = "Pengaturan ini memungkinkan Anda untuk mengonfigurasi jumlah minimum terowongan partisipan yang dihosting sebelum router mulai menolak permintaan terowongan berdasarkan kebutuhan bandwidth yang diantisipasi. [Defaultnya adalah 100 jika sistem menjalankan Android, 800 jika sistem berjalan pada ARM dan tersedia kurang dari 4 core, 1200 jika sistem berjalan pada ARM dan tersedia 4 core atau lebih, jika tidak, 2500]";
