    t[7030] = "In order to maintain anonymity, it is recommended to update using the I2P http proxy. If the news or I2P update is hosted on I2P, using the proxy will be necessary.";
    t[7031] = "Untuk menjaga kerahasiaan, direkomendasikan melakukan pembaruan menggunakan proxy http I2P. Jika pembaruan berita atau I2P dihosting di I2P, penggunaan proxy akan diperlukan.";
