    t[7308] = "SSU [IPv6 Only] with Introducers";
    t[7309] = "SSU yang hanya menggunakan IPv6, introducer";
    t[7312] = "SSU (Secure Semi-reliable UDP) is an I2P network transport providing encrypted, connection-oriented, point-to-point connections, in addition to IP address detection and NAT traversal services. For more information, see the <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7313] = "SSU (Secure Semi-reliable UDP) adalah transportasi jaringan I2P yang menyediakan koneksi terenkripsi, berorientasi koneksi, titik ke titik, selain deteksi alamat IP dan layanan traversal NAT. Untuk informasi lebih lanjut, lihat <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>dokumentasi online</a>.";
    t[7314] = "Congestion window";
    t[7315] = "Jendela kemacetan";
    t[7326] = "Use Proxy to Reseed";
    t[7327] = "Gunakan proxy untuk Reseed";
    t[7328] = "Until the advent of I2P integration in <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, it wasn't possible to download torrents that weren't hosted on the I2P network. However, now that Vuze (and latterly <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) allow users to share non-I2P torrents on I2P, non-I2P torrents can be downloaded over I2P if Vuze/Bigly users have chosen to make content available to the I2P network. Popular torrents with a large number of peers are more likely to be accessible via I2P; to determine if the content is available, add the torrent link, magnet or infohash to your I2P-enabled BitTorrent client.";
    t[7329] = "Sampai hadirnya integrasi I2P di <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, tidak mungkin untuk mengunduh torrent yang tidak dihosting di jaringan I2P. Namun, sekarang Vuze (dan kemudian <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) memungkinkan pengguna untuk berbagi torrent non-I2P di I2P, torrent non-I2P dapat diunduh melalui I2P jika pengguna Vuze/Bigly telah memilih untuk menyediakan konten ke jaringan I2P. Torrent populer dengan jumlah peer yang besar lebih mungkin terakses melalui I2P; untuk mengetahui apakah konten tersedia, tambahkan tautan torrent, magnet atau infohash ke klien BitTorrent berbasis I2P Anda.";
