    t[7429] = "Pengaturan ini (dalam jam) menentukan berapa umur RouterInfo di NetDb (tanggal publikasi terakhir yang diketahui) sebelum diklasifikasikan sebagai basi dan dihapus. [Defaultnya adalah 28 jam kecuali routernya adalah Floodfill, dalam hal ini defaultnya adalah 8 jam]";
