    t[7444] = "If a <i>Registration Authentication</i> string is requested, you can find it on the <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Registration Authentication page</a> linked from the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. Registration authentication ensures only the owner is able to register or otherwise manage the hostname, and is required on stats.i2p and reg.i2p.";
    t[7445] = "Jika diminta <i>Otentikasi Pendaftaran</i>, Anda dapat menemukannya di halaman <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Otentikasi Pendaftaran</a> yang terkait dari halaman <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Konfigurasi Pengelola Terowongan</a>. Otentikasi pendaftaran memastikan hanya pemilik yang dapat mendaftar atau mengelola hostname, dan diperlukan di stats.i2p dan reg.i2p.";
    t[7448] = "News &amp; Updates";
    t[7449] = "Berita &amp; Update";
    t[7452] = "[Linux/Unix/Solaris] If you can't start the router with <code>i2p/i2prouter start</code> try the <code>runplain.sh</code> script in the same directory. Root privileges are never required to run I2P+. If you need to compile the <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi library</a> (which is necessary in rare cases), consult the documentation, visit the forums, or visit <a href=irc://127.0.0.1:6668/saltR class=chatlink>the I2P+ channel</a> or <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC developer channel</a>.";
    t[7453] = "[Linux/Unix/Solaris] Jika Anda tidak dapat memulai router dengan <code>i2p/i2prouter start</code> cobalah skript <code>runplain.sh</code> di direktori yang sama. Hak akses root tidak pernah diperlukan untuk menjalankan I2P+. Jika Anda perlu menkompilasi <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>pustaka jBigi</a> (yang diperlukan dalam kasus jarang), konsultasikan dokumentasi, kunjungi forum, atau kunjungi <a href=irc://127.0.0.1:6668/saltR class=chatlink>saluran I2P+</a> atau <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>saluran pengembang IRC</a>";
