    t[7694] = "A threshold is defined by the number of connection attempts a remote destination is permitted to perform over a specified number of seconds before a \"breach\" occurs.";
    t[7695] = "Ambang batas didefinisikan oleh jumlah upaya koneksi yang diizinkan untuk dilakukan selama beberapa detik yang ditentukan sebelum 'pelanggaran' terjadi.";
    t[7704] = "Clearnet normally refers to the publicly accessible internet, the opposite of the darknet that typically describes the encrypted, anonymous services built on I2P, Tor etc. For more information, see the <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>Wikipedia article</a>.";
    t[7705] = "Jaringan jelas biasanya merujuk ke internet yang dapat diakses publik, berlawanan dengan darknet yang biasanya mendeskripsikan layanan terenkripsi, anonim yang dibangun di atas I2P, Tor dll. Untuk informasi lebih lanjut, lihat <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>artikel Wikipedia</a>.";
