    t[7991] = "Sebuah router di jaringan yang bertugas menyediakan dan menerima informasi tentang router dan layanan lain di jaringan. Bandwidth bagian minimum saat ini untuk sebuah router dianggap mampu melaksanakan tugas banjir adalah 128 KBytes/detik, meskipun memungkinkan untuk menimpa persyaratan ini dan memaksa sebuah router menjadi banjir di <a href=/configadvanced>Halaman Konfigurasi Lanjutan</a>. Untuk informasi lebih lanjut, lihat <a href=https://geti2p.net/en/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>dokumentasi online</a>.";
