    t[8208] = "Wherever possible, assets that are used repeatedly on your site should be loaded from an external file and not inlined. If you're using the same CSS on several pages, create a separate css file and load that in the <code>&lt;head&gt;</code> section of your pages. This will make styling updates to your site easier to manage, and will also allow the file to be cached in the visitor's browser, resulting in less bandwidth demands on your webserver and faster page loads for your visitors.";
    t[8209] = "Di manapun memungkinkan, aset yang digunakan berulang kali pada situs Anda seharusnya dimuat dari file eksternal dan bukan dikenakan. Jika Anda menggunakan CSS yang sama pada beberapa halaman, buatlah file CSS terpisah dan muatlah file itu pada bagian <code>&lt;head&gt;</code> halaman Anda. Hal ini akan mempermudah pengelolaan pembaruan gaya pada situs Anda, dan juga akan mengizinkan file disimpan di cache browser pengunjung, sehingga mengurangi beban bandwidth pada webserver Anda dan mempercepat muatan halaman bagi pengunjung.";
