    t[8258] = "If you think you have opened up your firewall and I2P still thinks you are firewalled, remember that you may have multiple firewalls, for example both software packages and external hardware routers.";
    t[8259] = "Jika anda berpikir anda telah membuka firewall anda dan I2P masih berpikir anda terlindungi firewall, ingat bahwa anda mungkin memiliki beberapa firewall, misalnya paket perangkat lunak dan perangkat keras berupa router eksternal.";
    t[8270] = "The keyword <i class=example>deny</i>. This threshold is always breached, i.e. no connection attempts will be allowed.";
    t[8271] = "Kata kunci <i class=example>deny</i>. Ambang batas ini selalu dilanggar, yaitu tidak ada upaya koneksi yang diizinkan.";
    t[8282] = "log visitors making 90 or more connections a minute";
    t[8283] = "mencatat pengunjung yang membuat 90 koneksi atau lebih dalam satu menit";
    t[8286] = "You have configured inbound TCP, however your UDP port is firewalled, and therefore it is likely that your TCP port is firewalled as well.";
    t[8287] = "Anda telah mengkonfigurasi inbound TCP, namun port UDP anda terhalang firewall, dan oleh karena itu sangat mungkin bahwa port TCP and juga terhalang firewall.";
    t[8296] = "This is the number of peers your router will use for network database inquiries. These are usually the <i>floodfill</i> routers which are responsible for maintaining network integrity. Your well integrated peers are shown on the bottom of the <a href='/profiles'>Profiles page</a>.";
    t[8297] = "Ini adalah jumlah peer yang akan digunakan router Anda untuk konsultasi basis data jaringan. Biasanya ini adalah router <i>floodfill</i> yang bertanggung jawab untuk memelihara integritas jaringan. Peer Anda yang terintegrasi dengan baik ditampilkan di bagian bawah halaman <a href='/profiles'>Profil</a>.";
    t[8298] = "Manage Router webapps";
