    t[8303] = "TCP keluar dari port tinggi acak ke port TCP remote sembarang. ";
    t[8310] = "When you start I2P, it may take a few minutes to bootstrap (integrate) your router into the network and find additional peers, so please be patient.";
    t[8311] = "Saat Anda memulai I2P, mungkin diperlukan beberapa menit untuk melakukan bootstrap (mengintegrasikan) router Anda ke dalam jaringan dan menemukan rekan tambahan, jadi harap bersabar.";
    t[8318] = "No file specified. Please select a valid .zip or .su3 file to reseed from.";
