    t[8320] = "Enable Universal Plug and Play (UPnP)";
    t[8321] = "Aktifkan Universal Plug and Play (UPnP)";
    t[8322] = "Unknown Wizard page";
    t[8323] = "Halaman Wisaya Tidak Diketahui";
    t[8326] = "NTCP &amp; SSU with Introducers [IPv6 Only]";
    t[8327] = "Hanya IPv6 NTCP, SSU, introducers";
    t[8332] = "Messages sent to peer";
    t[8333] = "Pesan dikirim ke rekan";
    t[8334] = "Function";
    t[8335] = "Fungsi";
    t[8336] = "On the I2P network, remotely hosted services can be accessed using a <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> address ending in \".b32.i2p\", a <i>destination</i> represented as a long <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> string, or more usually by using an .i2p domain. A destination is I2P's equivalent to an IP address, and is shown on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. You can share your b32.i2p address to allow others to access to your website until you've registered your own .i2p domain.";
    t[8337] = "Pada jaringan I2P, layanan yang di-host secara jarak jauh dapat diakses menggunakan alamat <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> yang berakhiran \".b32.i2p\", sebuah <i>tujuan</i> diwakili sebagai string panjang <a href=https://id.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a>, atau biasanya menggunakan domain .i2p. Sebuah tujuan setara dengan alamat IP pada I2P, dan ditampilkan di halaman <a href='/i2ptunnel/edit?tunnel=3'>Konfigurasi Pengelola Terowongan</a>. Anda dapat berbagi alamat b32.i2p Anda untuk mengizinkan orang lain mengakses situs web Anda hingga Anda mendaftarkan domain .i2p milik Anda sendiri.";
