    t[8410] = "To disable directory listings, find the entry for <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> in the <code>base-context.xml</code> file, located in the <code>eepsite/contexts</code> folder (just above docroot folder), and change 'true' to 'false' immediately underneath. To apply the change immediately, stop and restart the <i>I2P Webserver</i> client on the <a href=/configclients>Client Configuration page</a>. You can also drop an empty <code>index.html</code> file in any exposed directory to suppress directory listings for that location.";
    t[8411] = "Untuk menonaktifkan daftar direktori, temukan entri untuk <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> pada file <code>base-context.xml</code> yang terletak di folder <code>eepsite/contexts</code> (tepat di atas folder docroot), lalu ubah 'true' menjadi 'false' di bawahnya. Untuk mengaplikasikan perubahan segera, hentikan dan jalankan kembali klien <i>Webserver I2P</i> di halaman <a href=/configclients>Konfigurasi Klien</a>. Anda juga dapat memasukkan file kosong <code>index.html</code> ke direktori yang terekspos untuk menindas daftar direktori lokasi tersebut.";
