    t[8554] = "If you're not using IE, it's likely that your browser is pretending to be IE; please configure your browser (or proxy) to use a different User Agent string if you'd like to access the console themes.";
    t[8555] = "Jika Anda tidak menggunakan IE, kemungkinan browser anda berpura-pura menjadi IE; Konfigurasikan browser anda (atau proxy) untuk menggunakan string User Agent yang berbeda jika anda ingin mengakses console theme.";
