    t[8572] = "<a href=/logs>Logs</a> may help resolve a problem. You may wish to paste excerpts in a <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forum</a> for help, or perhaps <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>paste</a> it instead and reference the link on IRC for help.";
    t[8573] = "<a href=/logs>Log</a> mungkin dapat membantu menyelesaikan masalah. Anda mungkin ingin menempelkan cuplikannya di <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forum</a> untuk bantuan, atau mungkin <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>tempel</a> saja dan rujuk linknya di IRC untuk mendapatkan bantuan.";
    t[8574] = "Plugins signed with the cryptographic key of the developer are the recommended format, but if you wish to install unsigned plugins (.zip) you can set this to true. Note that you may still encounter issues attempting to install an unsigned plugin if the developer has included additional checks in the plugin build process.";
    t[8575] = "Plugin yang ditandatangani dengan kunci kriptografis pengembang merupakan format yang direkomendasikan, tetapi jika Anda ingin memasang plugin tidak ditandatangani (.zip) Anda dapat mengatur ini menjadi true. Perhatikan bahwa Anda masih dapat mengalami masalah ketika mencoba memasang plugin tidak ditandatangani jika pengembang telah menambahkan periksa tambahan dalam proses pembuatan plugin.";
    t[8578] = "If you are running a standalone Tor instance locally, you may use it by configuring I2P to use: <i>Proxy type:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8579] = "Jika Anda menjalankan instans Tor mandiri secara lokal, Anda dapat menggunakannya dengan mengkonfigurasi I2P untuk menggunakan: <i>Jenis Proxy:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8584] = "Select the language to be used for the router console and web applications (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrents</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>tunnel manager</a> etc). If you wish to change the language in future, change the router console theme, or configure a password to access the console, you may do so on the <a href=/configui target=_blank rel=noreferrer>User Interface configuration page</a>.";
    t[8585] = "Pilih bahasa yang akan digunakan untuk konsol router dan aplikasi web (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrents</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>pengelola terowongan</a> dan lainnya). Jika Anda ingin mengubah bahasa di masa mendatang, mengubah tema konsol router, atau mengkonfigurasi kata sandi untuk mengakses konsol, Anda dapat melakukannya di halaman <a href=/configui target=_blank rel=noreferrer>konfigurasi Antarmuka Pengguna</a>.";
