    t[9056] = "These are the local services provided by your router. They may be clients started through the <a href='/i2ptunnelmgr'>Tunnel Manager</a> or external programs connecting through SAM, BOB, or directly to I2CP. By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i>, which enhances anonymity by blending the traffic from all shared services, and reduces the overhead required to build and maintain tunnels. However, if you experience a tunnel failure, all your services will go offline at the same time, so in some scenarios you may wish to configure client services to use their own set of tunnels. This can be done by unchecking the <i>Share tunnels with other clients&hellip;</i> option listed under <i>Shared Clients</i> on the configuration page of the relevant client service in the Tunnel Manager, after which you will need to restart the client service from the <a href='/i2ptunnelmgr'>main Tunnel Manager page</a>.";
    t[9057] = "Ini adalah layanan lokal yang disediakan router Anda. Mereka mungkin klien yang dijalankan melalui <a href='/i2ptunnelmgr'>Pengelola Terowongan</a> atau program eksternal yang terhubung melalui SAM, BOB, atau langsung ke I2CP. Secara default, sebagian besar layanan klien Anda (surel, proksi http, IRC) akan berbagi satu set terowongan yang sama dan terdaftar sebagai <i>Klien Terbagi</i> dan <i>Klien Terbagi(DSA)</i>, yang meningkatkan anonimitas dengan mencampur lalu lintas semua layanan yang terbagi, dan mengurangi overhead yang dibutuhkan untuk membangun dan memelihara terowongan. Namun, jika Anda mengalami kegagalan terowongan, semua layanan Anda akan dinonaktifkan pada saat yang bersamaan, jadi dalam beberapa skenario Anda mungkin ingin mengonfigurasi layanan klien untuk menggunakan set terowongan sendiri-sendiri. Hal ini dapat dilakukan dengan mencabut centang pada pilihan <i>Berbagi terowongan dengan klien lain ...</i> yang terdaftar di bawah <i>Klien Terbagi</i> di halaman konfigurasi layanan klien yang relevan di Pengelola Terowongan, setelah itu Anda perlu memulai kembali layanan klien dari halaman <a href='/i2ptunnelmgr'>utama Pengelola Terowongan</a>.";
