    t[9240] = "A simple CGI application that takes a hostname as a parameter and returns a 301 redirect to the proper URL with a <code>?i2paddresshelper=key</code> string appended. The HTTP proxy will interpret the appended string and use the key as the actual destination. In addition, the proxy will cache the key so the address helper is not necessary until restart, and offer the option to add the resolved address to the addressbook.";
    t[9241] = "Aplikasi CGI sederhana yang mengambil hostname sebagai parameter dan mengembalikan redirect 301 ke URL yang tepat dengan tautan <code>?i2paddresshelper=key</code> yang terlampir. Proxy HTTP akan menginerpretasikan tautan yang terlampir dan menggunakan kunci sebagai tujuan sebenarnya. Selain itu, proxy akan menyimpan kunci sehingga address helper tidak diperlukan hingga restart, dan menawarkan pilihan untuk menambahkan alamat yang diselesaikan ke daftar alamat.";
