    t[9326] = "The router's external port allows communication with other routers. It is recommended to configure your firewall to allow inbound and outbound traffic on this port to optimize your router's performance on the network.";
    t[9327] = "Port eksternal router memungkinkan komunikasi dengan router lain. Disarankan untuk mengonfigurasi firewall Anda untuk memungkinkan lalu lintas masuk dan keluar di port ini untuk mengoptimalkan kinerja router Anda di jaringan.";
