    t[9354] = "Reseeding is the bootstrapping process used to find other routers when you first install I2P, or when your router has too few router references remaining. The default settings will work for most people. Change these only if HTTPS is blocked by a restrictive firewall and reseed has failed.";
    t[9355] = "Menghidupkan ulang adalah proses pembenaran awal yang digunakan untuk menemukan router lain ketika Anda pertama kali menginstal I2P, atau ketika router Anda sudah kekurangan referensi router. Pengaturan default akan berfungsi untuk sebagian besar orang. Ubah ini hanya jika HTTPS diblokir oleh firewall yang ketat dan penghidupan ulang gagal.";
    t[9362] = "This setting, when enabled, modifies the maximum additional random pong delay introduced for ping-enabled servers, if <code>i2p.streaming.enablePongDelay</code> is also enabled. Unless explicitly set, the default value of 50ms will be used.";
    t[9363] = "Pengaturan ini, ketika diaktifkan, memodifikasi penundaan pong acak maksimum tambahan yang diperkenalkan untuk server yang berkemampuan ping, jika <code>i2p.streaming.enablePongDelay</code> juga diaktifkan. Kecuali jelas ditetapkan, nilai default 50ms akan digunakan.";
