    t[9466] = "This may be a transient error, if the other program is no longer using the port.";
    t[9467] = "Ini mungkin error sementara, jika program lain tidak lagi menggunakan port tersebut.";
    t[9474] = "Your I2P+ router by default contributes to the network by routing internal, end-to-end encrypted traffic for other routers, known as <i>participation</i>. Bandwidth participation improves the anonymity level of all users on the network and maximizes your download speed.";
    t[9475] = "Router I2P+ Anda secara default berkontribusi ke jaringan dengan merutekan lalu lintas internal terenkripsi ujung ke ujung untuk router lain, yang dikenal sebagai <i>partisipasi</i>. Partisipasi bandwidth meningkatkan tingkat anonimitas semua pengguna di jaringan dan memaksimalkan kecepatan unduh Anda.";
    t[9476] = "This setting permits the configuration of alternative NTP servers required to ensure that your router maintains accurate clock time. [Default is 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9477] = "Pengaturan ini mengijinkan konfigurasi server NTP alternatif yang diperlukan untuk memastikan bahwa router Anda mempertahankan waktu jam yang akurat. [Defaultnya adalah 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9484] = "Optimize your images";
    t[9485] = "Optimalkan gambar Anda";
    t[9488] = "Note that the profiler relies on sustained client tunnel usage to accurately profile peers.";
    t[9489] = "Perhatikan bahwa profiler mengandalkan penggunaan terowongan klien yang berkelanjutan untuk membuat profil rekan secara akurat.";
    t[9492] = "If you are in a hurry and can't wait a few hours, you can tell people to use a \"jump\" address helper redirection service. This will usually work within a few minutes of your registering your hostname on the same site. Test it yourself first by entering <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> into your browser. Once it is working, you can tell others to use it.";
    t[9493] = "Jika Anda dalam keadaan terburu-buru dan tidak bisa menunggu beberapa jam, Anda dapat memberitahu orang lain untuk menggunakan layanan bantuan alamat \"lompat\" atau redireksi. Biasanya ini akan berfungsi dalam beberapa menit sejak Anda mendaftarkan hostname di situs yang sama. Cobalah terlebih dahulu dengan memasukkan <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> ke browser Anda. Sekali ini berfungsi, Anda dapat memberitahu orang lain untuk menggunakannya.";
