    t[9630] = "Tunnels built by other routers through your router. This may vary widely depending on network demand, your shared bandwidth, and amount of locally-generated traffic. The recommended method for limiting participating tunnels is to change your share percentage on the <a  href='/config'>Bandwidth Configuration page</a>. You may also limit the total number by setting <code>router.maxParticipatingTunnels=nnn</code> on the <a href='/configadvanced'>Advanced configuration page</a>. <a href='/configstats#tunnel.participatingTunnels'>[Enable graphing]</a>.";
    t[9631] = "Terowongan yang dibangun oleh router lain melalui router Anda. Hal ini dapat bervariasi lebar tergantung dari permintaan jaringan, bandwidth yang Anda bagikan, dan jumlah lalu lintas yang dihasilkan secara lokal. Metode yang disarankan untuk membatasi terowongan berpartisipasi adalah dengan mengubah persentase bagian Anda di halaman <a href='/config'>Konfigurasi Bandwidth</a>. Anda juga dapat membatasi total jumlah dengan mengatur <code>router.maxParticipatingTunnels=nnn</code> di halaman <a href='/configadvanced'>Konfigurasi lanjutan</a>. <a href='/configstats#tunnel.participatingTunnels'>[Aktifkan grafik]</a>.";
