    t[10038] = "To configure an alternative webserver for use on I2P, you can either use the existing webserver tunnel and <a href=/configclients>disable the default webserver</a> from running, or create a new HTTP Server tunnel in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Ensure that the webserver's <i>listening port</i> is also configured in the Tunnel Manager settings. For example, if your webserver is listening by default on address 127.0.0.1 port 80, you'd also need to ensure that the <i>Target port</i> in the Tunnel Manager settings page for the service is also configured to port 80.";
    t[10039] = "Untuk mengkonfigurasi server web alternatif untuk digunakan pada I2P, Anda dapat menggunakan terowongan webserver yang ada dan <a href=/configclients>nonaktifkan webserver default</a> dari berjalan, atau buat terowongan server HTTP baru di <a href=/i2ptunnelmgr>Pengelola Terowongan</a>. Pastikan port <i>pendengar</i> webserver juga dikonfigurasi pada pengaturan Pengelola Terowongan. Sebagai contoh, jika webserver Anda mendengarkan secara default pada alamat 127.0.0.1 port 80, Anda juga perlu memastikan bahwa <i>Port Sasaran</i> pada halaman pengaturan layanan Pengelola Terowongan juga dikonfigurasi ke port 80.";
