    t[10046] = "An I2P router usually only needs to be seeded once, to join the network for the first time. However, if the router is running for an extended period without network connectivity it may also need to be reseeded. Reseeding involves fetching multiple \"RouterInfo\" files (bundled into a signed zip-file) from at least two predefined server URLs picked from a volunteer-run group of clearnet HTTPS servers.";
    t[10047] = "Biasanya router I2P hanya perlu disemaian sekali, untuk bergabung dengan jaringan untuk pertama kalinya. Namun, jika router telah berjalan tanpa konektivitas jaringan selama waktu yang lama, mungkin juga memerlukan reseeding. Reseeding melibatkan pengambilan beberapa file \"RouterInfo\" (dibungkus dalam zip-file yang ditandatangani) dari minimal dua alamat URL server yang telah ditentukan sebelumnya, yang dipilih dari kelompok sukarelawan pengatur server HTTPS clearnet.";
