    t[10076] = "A list of countries derived from the <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>World Freedom Report</a> with a poor civil liberties reputation. This list is used to place routers running in the specified countries in <i>Hidden Mode</i> to provide enhanced security for users. The following countries are designated as strict: Afghanistan, Azerbaijan, Bahrain, Belarus, Brunei, Burundi, Cameroon, Central African Republic, Chad, China, Cuba, Democratic Republic of the Congo, Egypt, Equatorial Guinea, Eritrea, Ethiopia, Iran, Kazakhstan, Laos, Libya, Myanmar, North Korea, Palestinian Territories, Rwanda, Saudi Arabia, Somalia, South Sudan, Sudan, Eswatini (Swaziland), Syria, Tajikistan, Thailand, Turkey, Turkmenistan, Venezuela, United Arab Emirates, Uzbekistan, Western Sahara, Yemen.";
    t[10077] = "Daftar negara yang berasal dari <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>Laporan Kebebasan Dunia</a> dengan reputasi kebebasan sipil yang buruk. Daftar ini digunakan untuk menempatkan router yang berjalan di negara-negara yang ditentukan dalam mode <i>Tersembunyi</i> untuk menyediakan keamanan yang lebih tinggi bagi pengguna. Negara-negara berikut ditetapkan sebagai ketat: Afghanistan, Azerbaijan, Bahrain, Belarusia, Brunei, Burundi, Kamerun, Republik Afrika Tengah, Chad, Cina, Kuba, Republik Demokratik Kongo, Mesir, Guinea Khatulistiwa, Eritrea, Ethiopia, Iran, Kazakhstan, Laos, Libya, Myanmar, Korea Utara, Palestina, Rwanda, Arab Saudi, Somalia, Sudan Selatan, Sudan, Eswatini (Swaziland), Suriah, Tajikistan, Thailand, Turki, Turkmenistan, Venezuela, Uni Emirat Arab, Uzbekistan, Sahara Barat, Yaman.";
