    t[10312] = "Please wait for routing commitment to expire for {0} tunnel";
    t[10313] = new java.lang.String[] { "Harap menunggu routing komitmen berakhir untuk {0} tunnel" };
    t[10318] = "Where possible, please ensure I2P+/Java is allowed bi-directional port access from the internet by configuring your modem/router/pc firewall accordingly. If you're behind a prohibitive firewall but have unrestricted outbound access, I2P+ can still function; you can turn off inbound access and rely on <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>SSU IP Address Detection</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>firewall hole punching</a>) to connect you to the network, and your network status in the side panel will indicate \"Status: Firewalled\". For optimal performance, please ensure I2P's <a href=/confignet#udpconfig>external port</a> is visible from the internet (see below for more information).";
    t[10319] = "Di mana memungkinkan, pastikan I2P+/Java memiliki akses port bidirektional dari internet dengan mengkonfigurasi modem/router/firewall komputer Anda secara sesuai. Jika Anda berada di belakang firewall yang membatasi tetapi memiliki akses keluar tanpa batasan, I2P+ tetap dapat berfungsi; Anda dapat menonaktifkan akses masuk dan mengandalkan <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>Deteksi Alamat IP SSU</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>tembusan lubang firewall</a>) untuk menghubungkan Anda ke jaringan, dan status jaringan pada panel samping akan menunjukkan \"Status: Terblokir\". Untuk kinerja optimal, pastikan port eksternal I2P <a href=/confignet#udpconfig>terbuka</a> dari internet (lihat informasi lebih lanjut di bawah).";
