    t[11658] = "Your modem or router may support <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), which permits automatic port forwarding. Ensure UPnP support for I2P+ is enabled on the <a href=/confignet>config page</a>, then try to activate UPnP on your modem/router and possibly your computer also. Now try restarting the <a href=/>I2P+ router</a>. If successful, I2P+ should report \"Status: OK\" in the side panel once the I2P+ router completes initial connectivity tests.";
    t[11659] = "Modem atau router Anda mungkin mendukung <a href=https://id.wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), yang memungkinkan pembocoran port otomatis. Pastikan dukungan UPnP untuk I2P+ diaktifkan di halaman <a href=/confignet>konfigurasi</a>, kemudian coba aktifkan UPnP pada modem/router dan mungkin juga komputer Anda. Sekarang coba menghidupkan kembali <a href=/>router I2P+</a>. Jika berhasil, I2P+ seharusnya melaporkan \"Status: OK\" di panel samping setelah router I2P+ menyelesaikan uji konektivitas awal.";
