    t[12027] = "I2P FAQ ";
    t[12028] = "If you hover over the <i>Router Info</i> heading, your truncated router identity will be shown (the first four characters (24 bits) of your 44-character (256-bit) Base64 router hash). The full hash is shown on your <a href='netdb?r=.'>Network Database entry</a>. Never reveal this to anyone, as your router identity is uniquely linked to your IP address in the network database.";
    t[12029] = "Jika Anda meletakkan kursor di atas judul <i>Informasi Router</i>, identitas router yang terpotong akan ditampilkan (empat karakter pertama (24 bit) dari hash router Base64 44 karakter (256 bit) Anda). Hash lengkap ditampilkan pada entri <a href='netdb?r=.'>Basis Data Jaringan</a> Anda. Jangan pernah beritahukan ini kepada siapapun, karena identitas router Anda terkait secara unik dengan alamat IP Anda dalam basis data jaringan.";
