    t[12038] = "Directory listings (sometimes referred to as virtual directories) are enabled by default, so you can host files from a sub-directory of <code>docroot</code> without providing a page with links to the files. You can also serve content that exists outside of <code>docroot</code> by using a <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>symbolic link</a> to the desired directory.";
    t[12039] = "Daftar direktori (kadang disebut direktori virtual) diaktifkan secara default, jadi Anda dapat men-host file dari subdirektori <code>docroot</code> tanpa menyediakan halaman dengan link ke file-file tersebut. Anda juga dapat menyajikan konten di luar <code>docroot</code> dengan menggunakan <a href=https://id.wikipedia.org/wiki/Simbolik_link target=_blank rel=noreferrer class='sitelink external'>link simbolik</a> ke direktori yang diinginkan.";
